import React, { useState } from 'react';
import './App.css';

function App() {
  const [address, setAddress] = useState('');
  const [area, setArea] = useState('');
  const [numRooms, setNumRooms] = useState('');

  const handleAddressChange = (event) => {
    setAddress(event.target.value);
  };

  const handleAreaChange = (event) => {
    setArea(event.target.value);
  };

  const handleNumRoomsChange = (event) => {
    setNumRooms(event.target.value);
  };

  return (
    <div className="App">
      <div className="container">
        <div className="input-container">
          <input type="text" placeholder="Введите адрес" />
        </div>
        <div className="input-container">
          <input type="number" placeholder="Введите площадь" />
        </div>
        <div className="input-container">
          <input type="number" placeholder="Введите количество комнат" />
        </div>
        <button className="button">Предсказать цену</button>
      </div>
    </div>
  );
}

export default App;
